import React from "react";
import Index from "./components/index";
import "./App.css";
import {
  BrowserRouter as Router,
  Switch,
  Route,
  Link
} from "react-router-dom";
import LandingPage from "./components/LundingPage/LandingPage";

function App() {
  return (

    <Switch>
      <Route exact path="/">
    <LandingPage/>
      </Route>
<Route></Route>
      <Index />
    </Switch>
  );
}

export default App;
